  const svgRef = useRef<SVGSVGElement | null>(null);
  const groupRefs = useRef<(SVGGElement | null)[]>([]);

  useEffect(() => {
    const svg = svgRef.current;
    if (!svg) return;

    const pos = { x: 0, y: 0 };
    const target = { x: 0, y: 0 };

    const handleMouseMove = (e: MouseEvent) => {
      const rect = svg.getBoundingClientRect();
      const x = e.clientX - rect.left - rect.width / 2;
      const y = e.clientY - rect.top - rect.height / 2;

      // Multiply by sensitivity to increase movement
      target.x = x * 0.15; // bigger movement than before
      target.y = y * 0.15;
    };

    window.addEventListener("mousemove", handleMouseMove);

    const animate = () => {
      // Smoothly lerp toward target
      pos.x += (target.x - pos.x) * 0.08;
      pos.y += (target.y - pos.y) * 0.08;

      // Parallax effect: each group moves differently
      groupRefs.current.forEach((el, i) => {
        if (!el) return;

        // Depth multiplier (increase for faster movement)
        const depth = 0.3 + i * 0.2; // first layer slow, next faster
        gsap.to(el, {
          x: pos.x * depth,
          y: pos.y * depth,
          duration: 0.3,
          ease: "power2.out",
        });
      });

      requestAnimationFrame(animate);
    };

    animate();

    return () => window.removeEventListener("mousemove", handleMouseMove);
  }, []);

